import axios from 'axios'
import React, { Component } from 'react'

export default class Contact extends Component {

  state={
    allproduct:{}
  }

    componentDidMount(){
    var s= axios.get("http://127.0.0.1:8000/product");

    }
    
  render() {
    return (
      <div>{s}</div>
    )
  }
}
